$(document).ready(function get_json(){
   $.getJSON({
       type: 'GET',
       url: 'http://localhost:3000/json',
       dataType: 'json',
       success: function(data) {
           var items = []
           $.each(data, function(key, val) {
            console.log(val);
            items.push(
                  '<tr><td>' + val.name + '</td><td>' +  val.manufacturer + '</td><td>' + val.colour + '</td></tr>');
           });
           $(document).ready( function () {
             $('#table_id').DataTable({
               data: data,
               columns: [
                 { data: 'name' },
                 { data: 'manufacturer' },
                 { data: 'colour' }
               ]
             });
           });
        }
   });
   return false;
});
